import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

const people = ["John","Peter","Mary"];
const peoplelist = people.map(thekey => <h2>{thekey}</h2>)
const heelo = <h1>Hello word </h1>;

function Person(props) {
    return <h1>this person's name is {props.thename} </h1>
}

function Header(props) {
    return (
    <> 
        <h1>Hello world fro fucntion {props.username}</h1>
        <ul>
            {people.map()}
        </ul>
        <Person thename="Whothename" />
    </>);
}
const HeaderAR = () => <h1>Hello from arrow func</h1>;

class HeaderCL extends React.Component {
    render() {
        return <h1>Helo from class</h1>;
    }
}

ReactDOM.render(<Header username="John" />,document.getElementById('root'));
